INSERT INTO `field_data_field_body_1` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_body_1_value`, `field_body_1_format`) VALUES
('node', 'home', 0, 1, 1, 'und', 0, 'An active member of the business community for over 25 years, Network Communications is locally owned and operated, with its corporate headquarters and network operations based in the heart of East Texas. \r\n\r\nServing the regions of Longview, Kilgore, and Marshall, Network Communications can offer end-to-end solutions for all your telecommunications needs with a broad product line of the most advanced voice and data technology, backed by trustworthy, dependable, local customer service.', 'plain_text');
INSERT INTO `field_data_field_body_2` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_body_2_value`, `field_body_2_format`) VALUES
('node', 'home', 0, 1, 1, 'und', 0, 'Network Communications is the only company in East Texas that can deliver a complete fiber-optic  solution all the way to your premises with this state of the art next generation technology voice and data is delivered at the speed of light.  \r\n\r\nWe are ready to work with you to customize and design the right solution for your company’s needs, from reliability and cost efficiency to security and support. \r\n\r\nStart today by completing the Contact Request Form or calling us toll-free at 888.266.4835 Your Network Communications expert consultant is ready to help you find your way.', 'plain_text');
